import React from "react";
import Main from "./Main/Main";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import Header from "./Header/Header";
import "./css/core.css";
function App() {
  return (
    <>
      <Router>
        <Header />
        <Switch>
          <Route path="/" exact component={Main} />
        </Switch>
      </Router>
    </>
  );
}

export default App;
